import '../style/base.scss';
import '../style/Contact.scss'

function Contact () {
    return (
        <div className="contact">
            <h1 className="contact-title">Contact</h1>
            <span className="contact-email">vubh2015@gmail.com</span>
        </div>
    )
}

export default Contact
